import React from "react";
import { Button } from "react-bootstrap";
import "../utils/consts";
import { LOGIN_ROUTE } from "../utils/consts";
import {useLocation, useHistory, NavLink} from "react-router-dom";

const Header =() => {
    history = useHistory()
    location = useLocation()
    return(
        <div style={{background: '#424242', height: '20px', fontSize: '12px'}}>
            <div style={{display:'flex', paddingLeft: '8%', paddingRight: '8%', justifyContent:'right'}}>            
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}} onClick={history.pushState(LOGIN_ROUTE)}>Sign </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>My Account </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>Order Status </button>
                <button   style={{paddingRight: '26px', color: "white",border: 0, background: 'transparent', outline:'none'}}>Help </button>
            </div>
        </div>
    );
};

export default Header;
